import React from 'react';
import PropTypes from "prop-types";
import { connect } from "react-redux";
import { loginUser, setCurrentUser } from "../../../actions/authAutentications";

//componenti da react-bootstrap
import { Navbar, DropdownButton, Dropdown } from 'react-bootstrap';

//icone da material ui-icons
import PersonIcon from '@material-ui/icons/Person';
import { blue } from '@material-ui/core/colors';

//Componenti nostre
import Logo from '../../../immagini/logo.png'

let stile;


class MyNavbar extends React.Component{ 
    constructor(props){ 
       super(props); 
    }
    render(){ 
        try{
            const { user } = this.props.auth;
            if(user.ruolo==='Cliente')
            stile = 'Cliente'
        } catch (error){
            stile = 'Default'
        }
    switch(stile) {
            case 'Cliente':
                return( 
                <div>
                    <Navbar className="Navbar">
                        <Navbar.Brand href="/Login">
                        <img
                        src={Logo}
                        width="50"
                        height="50"
                        alt="Karm-Logo"
                        className="logonavbar"
                        />
                        </Navbar.Brand>
                        <Navbar.Toggle />
                        <Navbar.Collapse className="justify-content-end">
                        <DropdownButton id="dropdown-basic-button" ><PersonIcon style={{ color: "white", fontSize: 30}}/>
  <Dropdown.Item href="#/action-1">Action</Dropdown.Item>
  <Dropdown.Item href="#/action-2">Another action</Dropdown.Item>
  <Dropdown.Item href="#/action-3">Something else</Dropdown.Item>
</DropdownButton>
                        </Navbar.Collapse>
                    </Navbar>
                </div>
              );  
            default:
              return( 
                <div>
                    <Navbar className="Navbar" style={{display:'block', textAlign: 'center'}}>
                        <Navbar.Brand href="/Login">
                        <img
                        src={Logo}
                        width="50"
                        height="auto"
                        alt="Karm-Logo"
                        className="logonavbar1"
                        />
                        </Navbar.Brand>
                    </Navbar>
                </div>
              );   
          }
    }
 }

 MyNavbar.propTypes = {
    loginUser: PropTypes.func.isRequired,
    auth: PropTypes.object.isRequired,
  };
  
  const mapStateToProps = state => ({
    auth: state.auth,
  });
  
  export default connect(
    mapStateToProps,
    { loginUser }
  )(MyNavbar);
